import React from 'react';
import { BrowserRouter as Router, Route, Routes, Link } from 'react-router-dom';
import Techniques from './pages/Techniques';
import Materials from './pages/Materials';
import InterestBoard from './pages/InterestBoard';
import ProjectHistory from './pages/ProjectHistory';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <Router>
      <div>
        <ul>
          <li>
            <Link to="/techniques">Techniques</Link>
          </li>
          <li>
            <Link to="/materials">Materials</Link>
          </li>
          <li>
            <Link to="/interest-board">Interest Board</Link>  
          </li>
          <li>
            <Link to="/project-history">Project History</Link>  
          </li>
        </ul>
        <Routes>
          <Route path="/techniques" element={<Techniques />} />
          <Route path="/materials" element={<Materials />} />
          <Route path="/interest-board" element={<InterestBoard />} />
          <Route path="/project-history" element={<ProjectHistory />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
